Meet Lucky!!!&nbsp;He might not have been so&nbsp;lucky in the past, but we hope he will be lucky in the future. &nbsp;Lucky is almost 6&nbsp;year&nbsp;old Labrador Retriever/Cattle dog&nbsp;mix who was surrendered to a kill shelter because the kids were no longer interested in him and the mother didn&#39;t want to pay for someone to watch the dog when they went on vacation!!!&nbsp;

Lucky is amazingly affectionate, eager to please&nbsp;and&nbsp;housebroken. He bonds quickly with his owner and is protective of his both his home and owner. Because of this,&nbsp;he would make a great watchdog in a quiet household. &nbsp;He should go to home with an experienced, adult dog owner and he must be the only dog in the house.&nbsp;&nbsp;Lucky is very energetic and playful, he should get daily exercise, and a fenced in yard would be ideal.&nbsp;&nbsp;

11th Hour Rescue now wants to give this sweet, loving boy the chance to find a family who will love him, appreciate him, and treat him like one of the family. Lucky has undergone training for leash manners and basic obedience. &nbsp;&nbsp;

Lucky is&nbsp;up to date on vaccinations, neutered, and microchipped.

Don&#39;t you want to be the one that shows Lucky that he can be part of a loving family? &nbsp;If you&#39;re interested in Lucky go to EHRDOGS.ORG and submit an application. &nbsp;Don&#39;t forget to ask for LUCKY HAVARD!!!!

Hi! I&rsquo;m Daisy.&nbsp; I live at the Nowzad shelter in Kabul, Afghanistan.&nbsp; I am playful and understand certain commands such as &ldquo;come&rdquo; and &ldquo;sit&rdquo;.&nbsp; I am spayed, microchipped, and vaccinated.&nbsp; I am also trained to walk on a lead.&nbsp; Will you adopt me?

&nbsp;

&lsquo;This companion animal is currently in the Nowzad shelter in Kabul, Afghanistan. If you are interested in adopting, then the Nowzad charity will supply you with video and photographs and should the adoption go ahead will fundraise and arrange the transport for this companion animal to come to your home&rsquo;.

&nbsp;

&nbsp;

Hi, my name is GUL and I was found by some very kind humans in front of the Nowzad shelter. &nbsp;It was a very cold winter day and my siblings and I were very hungry and cold.&nbsp; My mom had a hard time keeping us warm.&nbsp; The human was kind enough to bring us into the shelter and provide us with food and blankets.&nbsp; I am still at the shelter now with my other siblings and am looking for a forever home.&nbsp; I promise to love you and keep you company if you adopt me!

&lsquo;This companion animal is currently in the Nowzad shelter in Kabul, Afghanistan. If you are interested in adopting, then the Nowzad charity will supply you with video and photographs and should the adoption go ahead will fundraise and arrange the transport for this companion animal to come to your home&rsquo;.

&nbsp;

&nbsp;

Sacramento - Poppy is one of our long-term fosters. She has been in her foster home for 4 years. She came to us from Yolo County Animal Services Shelter after she was left behind in a trailer and her people moved without taking her. She is approximately 7 years old now and a lean 50 lbs. Poppy is a happy, active, athletic girl. She has spent a lot of time on training, and has spent a lot of time in pack walks (with an extremely responsible handler).&nbsp; She loves to chase toys and do zoomies in the yard and leans into you for pets when she is done. Poppy prefers to be the only pet in the house though wouldn&rsquo;t might not mind sharing her home with a lackadaisical, submissive male that will let her rule the house and not try to correct her (and with correct and proper intros) but mainly we think it is better for her to be a single pet. She is crate and house trained, spayed,&nbsp;microchipped and up to date on vaccines.&nbsp;


If interested, you can go online and find our adoption process and apply online at: &nbsp; &nbsp; http://recycledpetsnorcal.org/adoptpet/


Adoption fee: $waived to the right family&nbsp;

Hotshot is a very special dog who needs a very special person.&nbsp; Hotshot is very small child aggressive so should not be in a home with small children, and should be kenneled when they come to visit.&nbsp; Hotshot is very protective of her person and may be a little fussy at others who come too near, even if they are adults, especially male.&nbsp; At night he sleeps against the door in his foster mom's bedroom in order to protect her from any monsters that may try to sneak in and harm her.&nbsp; He is like dynamite....small but explosive.The ideal situation for this beautiful dog is a lady who lives alone and desires companionship.&nbsp; Hotshot would gladly sit on their lap all day long.&nbsp; He adores the person he bonds to and would very willingly give his life to protect her.He does not do well with other dogs but usually just gets his bluff on them.&nbsp;
Please apply online at www.louisianalifeline4k9s.org. As a purely foster based rescue, we do not have a central location where you can view our dogs and therefore we honor meeting request from pre-approved adopters. Completing the adoption application does not obligate you to anything, however, it gives us the chance to find your perfect match! Hotshot's adoption fee is $125, it includes all shots, neuter and microchipping.
&nbsp;
&nbsp;
&nbsp;
&nbsp;
&nbsp;

Tigger,&nbsp;a high-energy bull terrier and pit bull mix born in late 2015, 
&nbsp;is the friendliest, most fun-loving&nbsp;little guy. He absolutely loves everyone he meets. While he especially loves children he is better suited to&nbsp;older kids, not little ones.&nbsp; He likes to be king of his castle, so he should be the only pet in his home. And his home should be&nbsp;in a quiet suburb with a fenced yard where Tigger&nbsp;can play and burn off his energy. He loves his people so much, he needs them to be home a lot.&nbsp;&nbsp;If you are an experienced dog owner who can give Tigger the forever home he&#39;s looking for, fill out an application at&nbsp;www.rescuedogsrocknyc.org

&nbsp;



&nbsp;




RDR&#39;s adoption fees include the cost of spay/neuter/microchip at an RDR-approved facility, whether completed before adoption or if deferred because&nbsp;the pet is too young or has a medical issue.&nbsp; All pets are also current on age-appropriate vaccines at the time of adoption



Given technical constraints on this database, this pet&#39;s location may not be as listed here. We can, however, provide transport support for pets in foster at a considerable distance from the adopter.

Chap, born 3/2016, finds himself back in rescue after his family had a new baby.&nbsp; He came into rescue as a small puppy with his siblings after being found abandoned in NC.&nbsp; Chap 
&nbsp;loves to cuddle at night and being outside during the day. Loves walks and kids. He is house trained and knows some commands. He&rsquo;s very affectionate.&nbsp; Chap doesn&#39;t mind small doggie&nbsp;friends, cats unknown.&nbsp;&nbsp;
Please apply to make Chap part of your family today! www.rescuedogsrocknyc.org&nbsp;


RDR&#39;s adoption fees include the cost of spay/neuter/microchip at an RDR-approved facility, whether completed before adoption or if deferred because&nbsp;the pet is too young or has a medical issue.&nbsp; All pets are also current on age-appropriate vaccines at the time of adoption



