Pepper was born about May 15, 2015 and weighs about 50 lbs.&nbsp; She is a Joyful Rescues sanctuary pet because she arrived from the southern high kill shelter extremely fearful of humans, but she is wonderful with all the other dogs here.&nbsp; Pepper never found a home because she has a very fast bite response to any human that moves too fast around her or in any situation where she feels uncertain what the human may do - even to reach out and pet her.&nbsp; Every one here understands this and new humans in the house are told ahead of entering not to reach out to Pepper.&nbsp; With this understanding of her behavior she has been living here and will continue to live here happily.&nbsp; She enjoys the activity and the acreage playing with the other dogs and is welcome to stay as long as she lives.
&nbsp;
Joyful Rescues has no funding except for our adoption fees and miscellaneous donations. Pet care and vet bills are expensive - you must be ready to take on this financial (as well as emotional) responsibility. 
&nbsp;
 Can't Adopt Me?&nbsp;   SPONSOR ME 
