Nina was taken in by her foster family on the coldest night of the year in early 2016. Since then, she has decided that she loves the indoor cat life complete with the head scratches, toys, love, and of course food! Nina was born sometime in late 2014.&nbsp;

Nina has become quite social and outgoing and loves playing with the other cats in her foster home. She is initially shy with humans, but has had no problem becoming friendly with her foster people (especially if they are making her food). Once she has warmed up to you, Nina is very vocal and quick to purr. Nina has had no problems with the dog in her foster home. She would do best with another cat in her furever home to play with.

Our kitties are vaccinated, spayed/neutered, negative for FIV and FeLV, wormed, and litter box trained.&nbsp; Nina&#39;s adoption fee is $75.&nbsp;


Please email felinefriendsnc@gmail.com for an application or fill out application online at&nbsp;http://www.felinefriendsnc.com/application.html

Meet Raider! Raider is a wonderful boy!&nbsp; He is great with other animals and loves their company.&nbsp; He also loves the company of adults but kids tend to make him a bit uncomfortable so he would probably do best in a home without kids.&nbsp; He is also very handsome, but don&#39;t tell him yet, he doesn&#39;t know. :) Raider is non reactive to Cats, he&#39;s just a fun, overgrown Pup looking for a forever home.&nbsp; He would do best in a home with another pet, no children and alpha parents.&nbsp;&nbsp; Please consider giving Raider a home or foster home to call his own!

