After being on the run for 6&nbsp;months Hannah is now ready for a home of her own. She has spent the last year in a foster home learning what it&#39;s like to be a loved member of a family. She must have a secure fenced in yard, another dog or dogs that she can bond with, and only older responsible children. Hannah loves dogs and all people once she warms up. She is super loving, goofy and playful. Hannah is still a flight risk though and can get nervous, so a family that is willing to work with her and give her time to settle will be a must, and she will love you forever!&nbsp;She is housebroken, spayed, microchipped, and up to date on shots. Any interested families will need a home check prior to adopting.
&nbsp;

If Hannah might be the one for you go to EHRDOGS.ORG and submit an application. &nbsp;Don&#39;t forget to ask for HANNAH STEELE!!!

&nbsp;

Look at this boy!&nbsp; Fletcher is a sweet boy, with the right person/people.&nbsp; He loves most of the volunteers at the shelter, but is very aloof with others, he seems to love women mostly.&nbsp; He is perfectly&nbsp;content with hanging out on a shelf, but boy as soon as that door opens, he&#39;s right there for lovies.&nbsp; He&#39;s a quiet boy and&nbsp;is selective of his kitty and people companions, but hey, maybe we all could take a lesson from him and be more selective of our companions ;)&nbsp; If you think Fletcher is your guy, go ahead and fill out an adoption application!

Fletcher is up to date on vaccines, neutered, and micro chipped.&nbsp;&nbsp;
Please go to our website at www.emmetcountyanimalshelter.org to fill out the Cat Adoption Application.&nbsp; All cat adoption fees are free will for approved applicants.&nbsp;

DOB:&nbsp;June, 2015 &nbsp;





BREED/COLORING:&nbsp;Maltese/Poodle/Terrier Mix; Tan with White&nbsp; (look thru all of his pix to see how long his hair grows... he can look very different from summer cut to winter coat!)





SIZE: Nerf weighs about 16lbs and is full grown.&nbsp; 





HISTORY:&nbsp; Nerf was running loose in the desert for a couple of weeks. He finally came to a mechanic shop that took him in and contacted us to find him a home.&nbsp; 





PERSONALITY: Nerf is a total sweetheart and very people oriented. He wants laughs and loves and to Run! Run! Run! Lots of energy &ndash; but also lots of affection. 





TRAINING: Nerf is at a cage-free kennel facility so we are not sure of his housebreaking skills. He may need some &ldquo;rework&rdquo; on his skills.&nbsp; 





WOULD DO BEST:&nbsp; Nerf would love to have another dog &ndash; of any size &ndash; to play with and would like a yard space to run around and goof in.&nbsp;





CATS/DOGS/KIDS: Nerf does great with other dogs of all sizes. He is great with cats too. Nerf is not recommended for homes with young children because he can be a &ldquo;door darter&rdquo; and a runner.&nbsp; 





Vet Record:&nbsp;All of our dogs are currently vaccinated, spayed/neutered and microchipped prior to adoption.




AVAILABILITY:&nbsp;This dog is available for adoption now and is being&nbsp;fostered or kenneled in the San Fernando Valley area. Please email us and we&nbsp;will send you an adoption application. Local adoptions only (we do not ship dogs).



Visit our website: http://www.foreverhomepetrescue.org/&nbsp;


&nbsp;

Hello everyone! &nbsp;My name is Sabor and guess what? &nbsp;I am the world&#39;s sweetest dog! &nbsp;Here are a few basic facts about me.&nbsp; I am&nbsp;just a rescue dog and nothing fancy. I&#39;m estimated to be around 10 years old. Looks like I am a chihuahua mix of some sort. I&#39;m mostly black with some tan on my face and paws. I weigh about 14 pounds, and if you love me, you won&#39;t overfeed me because I sure love to eat. But I also love to take short walks and I&#39;m great on a leash. The walks are good for me and you, and I don&#39;t pull on the leash at all. By the way, I am also&nbsp;great when I encounter other dogs or people.

In fact, I&#39;m fabulous with other dogs. I live in a foster home with a bunch of other dogs and get along with everyone. I am a very laid back and low energy guy. I am crate trained and housetrained (if kept on a frequent schedule). I don&#39;t bark much either. I do have to tell you that I have several health issues and need to take medication twice a day. I take my pills very easily. Just put them in a bit of cheese or lunch meat or a pill pocket. I am very well controlled on my medication and, except for some hair loss and bigger-than-average tummy, you would never know that I have any health problems.

So you see, I&#39;m just about perfect. I love to snuggle on your lap and I&#39;m affectionate, but not needy. I would do great in a variety of homes. Toddlers and young children probably would not be my best match as I&#39;m a mature fellow, but older ones are fine. I&#39;m also adaptable and could easily enjoy life in an apartment or a house with a fenced yard. My only requirement is a loving home...Is that yours?











&nbsp;

For inquiries, email inquiry@angelsrescue.org &nbsp;











An Adoption Application for this dog can be found and submitted online. &nbsp; http://www.angelsrescue.org/adopt/adoption-forms

&nbsp;

Her name is Italian, and mama mia, she&rsquo;s one cute little meatball! Gianna is a 7-year-old, female, spayed, pocket-size pittie, weighing in at 46 pounds. She is a beefy girl with a blocky head and the cutest stumpy legs. She enjoys cuddling, getting out for walks and field trips, and playing with her toys (especially ripping apart stuffed ones). She loves any tasty treat, but her favorite is a Kong toy stuffed with peanut butter. Gianna loves people, but is not a fan of other pets, so she&#39;d&nbsp;like to find a&nbsp;family where she is their one &amp; only &quot;amore&quot;.


&nbsp;

Check out Gianna&#39;s TV spot: &nbsp;http://bit.ly/32JShO3-Gianna

&nbsp;

For inquiries, email inquiry@angelsrescue.org&nbsp;

An Adoption Application for this dog can be found and submitted online at http://www.angelsrescue.org/adopt/adoption-forms

Please be sure to like our Facebook page https://www.facebook.com/angelsrescue.&nbsp;

Venus is a golden eyed beauty with the prettiest coat. &nbsp;Venus needs a family willing to help her become the kit&nbsp;we know she can become. &nbsp;When she arrived at our center she was very shy, and you couldn&#39;t hardly touch her.&nbsp; Now she&#39;s come such a long way where she will let you pet her on her terms.&nbsp;&nbsp;She still needs someone willing to give her some extra TLC in a quiet environment. &nbsp;With a kind, patient&nbsp;and loving hand we know she will make a great kit she desires to be.
&nbsp;
&nbsp;She really does want her furrrrever home and will fill your life with joy.

Sweety is a beautiful cat that needs a person that would love to see her for who she is and work with a shy, timid kit&nbsp;and is willing to go the extra mile to help her overcome her shyness. &nbsp;She shies away from people, but in a quiet environment, we think she&#39;d come around in time. &nbsp;If you&#39;re one of those people that can meet a cat on their own terms, and be happy with the small successes you experience, please consider helping Sweety.&nbsp; She is such a beautiful kit on the inside and out.&nbsp; We&#39;ve seen her grow into this wonderful soul and know with the proper TLC, she will make a great companion in a quiet environment and blossom.





&nbsp;

&nbsp;

Strawberry was born about May 12, 2015 and is with us because her family is having a human baby. &nbsp;So often the pets are considered disposable with this life changing event.&nbsp;The&nbsp;baby sure missed out on the opportunity of growing up with a sweet, wonderful kitty. &nbsp;Maybe it's best overall, because Strawberry came to us in heat, and&nbsp;that will be her last one.&nbsp;Strawberry is just a social butterfly and&nbsp;will happily greet everyone she meet! She&nbsp;is great&nbsp;with other cats, dogs, and kids of all ages. She loves to go for car rides and also likes to help us fold laundry (see picture!)&nbsp;She is the sweetest cat you will ever meet. She comes when you call her and is happy to give you all the kitty kisses and head bonks you want. She has a wonderful purr that will relax you and she is really soft, so you will really love to hold her against you. And she LOVES to knead!&nbsp;She&nbsp;will&nbsp;adore you&nbsp;forever. &nbsp;She is now spayed and&nbsp;ready to find a truly forever home.
&nbsp;
Strawberry has recently developed FHV, feline herpes virus. It effects her right eye and is considered to be contagious to&nbsp;unvaccinated&nbsp;cats.&nbsp;She&nbsp;needs a special home where she can be the only cat, or be in a home that also has cats with this virus. Good nutrition is essential for her,&nbsp;in&nbsp;addition to&nbsp;L-lysine treats&nbsp;that&nbsp;are very effective in controlling flare-ups and also help to boost the immune system.&nbsp;
&nbsp;
Joyful Rescues remains committed to our Sanctuary Dogs and Cats. They will stay with us for their natural lives and we will care for and love them. We will be their forever family. We wish we could do it alone but we need your help. We are looking for people who can help us with Strawberries care. Please click the link below and donate. Chloe thanks you. https://www.paypal.com/donate Can't Adopt Me? SPONSOR ME Look for the Link "Special Instructions to Seller" if you want to note a particular pet

