Oink is a bulldog cross looking for a home. She is dog friendly, people friendly, and very sweet! Don&#39;t let that fool you though, she&#39;s a typical bulldog with a typical bulldog personality. If she doesn&#39;t want to do it, it isn&#39;t going to happen!&nbsp;

Oink has pretty severe separation anxiety and needs to be on anti anxiety meds. She would do best with a stay at home person.

