We are not really sure of Dillon&rsquo;s breed mix.&nbsp; He has a dachshund-like body (long and low)&nbsp;with the head of a tiny yellow lab!&nbsp; Dillon really&nbsp;deserves a family who wants to help him develop some confidence and some manners so he can be the lucky dog he is meant to be.&nbsp; He is very excitable and vocal when left alone for too long&nbsp;and will not be the best apartment resident.&nbsp; 
