A Tail of the Good, the Not So Good, and the Ugly

The Good&hellip;

Lucas is a puppy mill survivor.&nbsp; He is a handsome, white with liver spotting 6-8 year old IG.&nbsp; Lucas is affectionate and wants nothing more than to be with you.&nbsp; He loves to sit next to you on the sofa and makes a great lap warmer.&nbsp;He walks well on a leash and is crate trained.&nbsp; He gets along with large and small dogs and is cat safe.&nbsp;

The Not So Good&hellip;

Due to his years of living in a small, crowded cage, Lucas is afraid of big, open spaces, especially outdoors.&nbsp; He usually has to be carried outside and will run back indoors if you leave the door open.&nbsp; He will stay close to you while he is outdoors.&nbsp; Potty training is a work in progress&mdash;he is about 80-85 percent reliable if kept on a schedule.&nbsp; Lucas takes medication to help with his anxiety.

Lucas has come a long way since he was rescued from the puppy mill.&nbsp; He still has the scars, but has made slow, but steady progress.&nbsp;

The Ugly&hellip;

Lucas is one of the lucky ones who made it out of a puppy mill alive.&nbsp; There are still hundreds of thousands dogs (and cats) who are trapped in a hell on earth.&nbsp; Each of us can do something to help those still suffering in the mills.&nbsp; Call a rescue group today and ask what you can do to help.

Lucas has a lot of love to give and will make a wonderful companion for someone who has a lot of love to give back and a lot of patience to help him continue on his journey to become a loving member of a loving home.&nbsp; He is being fostered in San Antonio.

