ROCCO is a goofy and loving medium-sized young man who adores life and just wants to love and be loved!&nbsp; And that's amazing because he had a rough start in life. BACKGROUNDWhen Rocco was just 6 months old, he was hit by a car and taken to a Kansas shelter as a stray.&nbsp; He had an injured back leg and the shelter did surgery, but they waited 3 weeks to do it and the surgery was successful but left him with a funny way of running and some lingering stiffness/pain&nbsp; (though it doesn't affect his running, jumping or movement).
After he recovered, the shelter adopted him to a man in Missouri but didn&rsquo;t do a home check or vet the adopter.&nbsp; Tragically, the adopter threw Rocco out in the back yard and completely ignored him.&nbsp; A year later he dumped Rocco at a different shelter claiming his landlord would no longer allow him to have a dog.&nbsp;
Then Rocco came to MOGS -- and not a minute too soon! &nbsp;He was literally starved to a&nbsp;&nbsp; bone.&nbsp; He was also starved for affection, totally unfamiliar with other dogs, had no manners, and was an over-the-top bundle of energy -- a super-affectionate boy with rough edges.&nbsp; Today he&rsquo;s still energetic but has learned manners and is just happy to be loved and alive!
TEMPERAMENTRocco bonds quickly and hard to his people, and adores having visitors to the home as well.&nbsp; He loves people despite his past neglect. &nbsp;He&rsquo;s a smart&nbsp; boy and has learned many commands, like &ldquo;sit,&rdquo; &ldquo;wait,&rdquo; go &ldquo;outside,&rdquo; come &ldquo;inside,&rdquo; &ldquo;go to bed,&rdquo; &ldquo;free,&rdquo; &ldquo;come,&rdquo; and &ldquo;eat.&rdquo; &nbsp;&nbsp;He&rsquo;s also working on learning both verbal and hand signal commands for &ldquo;down,&rdquo; &ldquo;quiet,&rdquo; and &ldquo;place.&rdquo; &nbsp;&nbsp;&nbsp;
Rocco sometimes thinks he&rsquo;s a big lap dog when he wants cuddles and attention. He loves to go for walks and car rides, and is working on not demonstrating his gymnastic abilities on a leash. He loves to race around in his backyard but settles down nicely once inside. He&rsquo;s working on crate-training, but sometimes thinks he is a crate Houdini, especially if he wants to get to his person. If you make a good impression on him, he might even let you skritch his new favorite itchy spot over his back hips!&nbsp;&nbsp; Rocco is basically just so happy to be alive, safe and loved that sometimes his enthusiasm gets the better of him.&nbsp;
OTHER ANIMALSRocco has worked hard at it at getting along with other dogs his own size or bigger but does so for short periods of supervised time. &nbsp;&nbsp;Due to his history of neglect, he sometimes wants to lay claim to food, toys, beds, etc., as only his. Even though he is making progress with other GSD buddies in his foster home, Rocco would be best as an only pet, so he can have his fur-ever family&rsquo;s undivided attention.&nbsp; He does not get along with cats, and we believe that during his year of neglect and starvation, he probably survived by hunting squirrels and other small critters.
CHILDRENRocco has been fine around all people, but due to his enthusiasm and strength we recommend children over 16 years old.
MEDICALRocco is fully vetted and in excellent health overall.&nbsp; He takes supplements and low-level pain meds to ease the stiffness in his injured back leg.&nbsp;&nbsp; The injury and delayed surgery left him with a different way of running but that doesn't affect his running, jumping or movement at all (he can jump a 4 ft fence).IDEAL HOMERocco:

wants a family who wants a best pal for life!&nbsp;
wants someone who will love-love-love him, take him on walks and rides, and generally adore him and his goofy antics.
needs a strong leader who will gently-but-firmly correct him when he gets too enthusiastic or if he begins to claim toys, beds, people etc.&nbsp;
will do best as an only pet, and with older kids only (16 yrs and up).
would love a securely fenced yard to&nbsp; run and romp in.
needs daily moderate exercise.

Goofy Rocco has come a very long way with the love and leadership of his dedicated foster home.&nbsp; He has worked hard and learned a lot.&nbsp; He's full of love and just waiting to share it with some lucky family.&nbsp; Are YOU that lucky person who will look in his big bronn eyes every day and fall in love all over again?
Are you looking for a handsome, loving buddy who just wants to love and be loved?
ROCCO just might be your heart dog!!
