RESCUING CHIPPER (FORMERLY NOODLE)
Chipper and another puppy named Nutmeg ended up at Henry County Animal Control, a county shelter that does not adopt pit bulls out to the public. Luckily we had a foster step up for both of them and we were able to get them out of the pound on Good Friday, 4/14/2017.

ABOUT CHIPPER
Chipper is almost 5 years old and he is such a cool dog and absolutely beautiful!&nbsp; Chipper is a super smart and happy boy.&nbsp; He is medium energy, loves a good zoomie in the yard and loves a good couch snuggle fest.&nbsp; Chipper went into a foster home back in April 2017 when he first came into our rescue from the shelter.&nbsp; His foster mom ended up adopting him on 3/30/2018 after falling in love with this boy.&nbsp; He has a doggie sister named Snow who is a white pitbull and his best friend.&nbsp;

Unfortunately, Chipper&#39;s&nbsp;mom&#39;s home life has had some changes which includes a new home in the country with a boyfriend and 2 young children on a part-time basis.&nbsp; Not being used to young kids, Chipper is nervous and snappy around the children so he has to wear a basket muzzle for safety when the children are around.&nbsp; At his old home he had a 6 foot privacy fenced yard with an electric fence to ensure he did not get out.&nbsp; However, his new home is&nbsp;on a large amount of land that is unfenced and when Chipper gets a whiff of the horses or goats nearby he tends to take off and roam which is not safe for him to do in the country.&nbsp; The safety of Chipper and the children is the biggest priority and we are seeking a new home for Chipper where he will be happier and kept safe&nbsp;while outside playing/pottying.&nbsp; Chipper listens well and would do best with an adult(s) that are alpha owners.&nbsp; Although he gets along well with Snow (his doggie sister) he probably would do best as an only dog.&nbsp; Another dog is a possibility with slow introductions but it may take work.&nbsp;&nbsp;He does not do well with cats or children under 16.&nbsp; He walks OK on a leash but hasn&#39;t been regularly walked in a while.&nbsp; He is housebroken, crate-trained and loves riding in the car.&nbsp; He leads a pretty spoiled life right now filled with puppacino&#39;s, kiddie pools, bed snuggling and lots of attention.&nbsp; However, his current mom wants him to live a long happy unrestricted life and wants what is best for him.&nbsp; We are all hoping that someone out there can give this boy a chance to find the perfect family that can work with his quirks.&nbsp; He has a lot of love to give and is just the sweetest boy.&nbsp;&nbsp;

If you are interested in learning more about Chipper or meeting him please call, text or email Holly at (678) 939-6981 or holly@friendstotheforlorn.org.&nbsp; You can also complete an adoption application online at:&nbsp;&nbsp;https://www.friendstotheforlorn.org/adoption-application/&nbsp;&nbsp;

